import React from "react";

import { Container, ContainerNavigation, Ads } from "./styles";
import Button from "../../styles/components/Button";
import api from "../../services/api";
import Navigation from "../../components/Navigation";

let data = [];

export default function Anuncio({ history }) {
  async function handleSubmit() {
    history.push("/ads");
  }

  const loadAds = setTimeout(async function() {
    const response = await api.get("/ads");
    data = response.data.docs;
    console.log(data);
  }, 1000);

  return (
    <div>
      <ContainerNavigation>
        <Navigation />
        <Container>
          <header>
            <h1>Anúncios</h1>
            <div>
              <Button onClick={handleSubmit}>+ Novo</Button>
            </div>
          </header>
          <div>
            {data.map(function(object) {
              return (
                <Ads key={object._id}>
                  <p>Título: {object.title}</p>
                  <p>Descrição: {object.description}</p>
                  <p>Preço: R$ {object.price}</p>
                  <p>Autor: {object.author.name}</p>
                </Ads>
              );
            })}
          </div>
        </Container>
      </ContainerNavigation>
    </div>
  );
}
